import Nav from 'react-bootstrap'
function Navbar() {
    return (
        <Nav variant="tabs" defaultActiveKey="/home">
            <Nav.Item>
                <Nav.Link href="/home">Active</Nav.Link>
            </Nav.Item>
            <Nav.Item>
                <Nav.Link eventKey="link-1" href="/google.es">Option 2</Nav.Link>
            </Nav.Item>
            <Nav.Item>
                <Nav.Link eventKey="link-1" href="/google.es">Option 3</Nav.Link>
            </Nav.Item>

        </Nav>
    );
}

export default Navbar;
